	module.exports = "<h1 id=\"cis-700-special-topics-in-procedural-graphics\">CIS 700 - Special Topics in Procedural Graphics</h1>\n<h3 id=\"spring-2016-university-of-pennsylvania-rachel-hwang\">Spring 2016 - University of Pennsylvania | Rachel Hwang</h3>\n<p><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/videoseries?list=PLpSPa9ShaFDc09g5YMuK4y61zpPCmdagw\" frameborder=\"0\" allowfullscreen></iframe>\n<br/></p>\n<style>\n.project {\n  display: inline-block;\n  margin-left: 10px;\n  margin-top: 10px;\n}\n\n.project .name {\n  font-size: 16px;\n}\n\n.project iframe {\n  border: none;\n  width: 250px;\n  height: 250px;\n}\n</style>\n\n<h3 id=\"noise\">Noise</h3>\n<div class='project'><div class='name'>Brian Tong</div><iframe src='//www.giphy.com/embed/l0IyadaDuCcEyeybu'></iframe><div class='links'><a href='https://github.com/iambrian/Project1-Noise'>Github</a> | <a href='https://iambrian.github.io/Project1-Noise/'>Demo</a></div></div>\n<div class='project'><div class='name'>Dan McCann</div><iframe src='//www.giphy.com/embed/l0Iyb4GcDecAawZos'></iframe><div class='links'><a href='https://github.com/mccannd/Project1-Noise'>Github</a> | <a href='https://mccannd.github.io/Project1-Noise/'>Demo</a></div></div>\n<div class='project'><div class='name'>Mariano Merchante</div><iframe src='//www.giphy.com/embed/3oKIP6D9sXtrnBYNLa'></iframe><div class='links'><a href='https://github.com/mmerchante/playing-with-noise'>Github</a> | <a href='https://mmerchante.github.io/playing-with-noise/'>Demo</a></div></div>\n\n<h3 id=\"procedural-wing\">Procedural Wing</h3>\n<div class='project'><div class='name'>Brian Tong</div><iframe src='//www.giphy.com/embed/l0IyiNSjj8jsyfvna'></iframe><div class='links'><a href='https://github.com/iambrian/Project-2-Toolbox-Functions'>Github</a> | <a href='https://iambrian.github.io/Project-2-Toolbox-Functions/'>Demo</a></div></div>\n<div class='project'><div class='name'>Mariano Merchante</div><iframe src='//www.giphy.com/embed/l4FGzJbw3RrvuP11m'></iframe><div class='links'><a href='https://github.com/mmerchante/angels-and-men'>Github</a> | <a href='https://mmerchante.github.io/angels-and-men/'>Demo</a></div></div>\n\n<h3 id=\"l-systems\">L-Systems</h3>\n<div class='project'><div class='name'>Andrea Lin</div><iframe src='//www.giphy.com/embed/3oKIP8BCpFK66C30Nq'></iframe><div class='links'><a href='https://github.com/andreahlin/Project3-LSystems'>Github</a> | <a href='https://andreahlin.github.io/Project3-LSystems/'>Demo</a></div></div>\n<div class='project'><div class='name'>Tabatha Hickman</div><iframe src='//www.giphy.com/embed/3oKIPprivtc4p4jc1a'></iframe><div class='links'><a href='https://github.com/tabathah/Project3-LSystems'>Github</a> | <a href='https://tabathah.github.io/Project3-LSystems/'>Demo</a></div></div>\n<div class='project'><div class='name'>Emily Vo</div><iframe src='//www.giphy.com/embed/xUPGcfi99QrktXT8Jy'></iframe><div class='links'><a href='https://github.com/emily-vo/Project4-Shape-Grammar'>Github</a> | <a href='https://emily-vo.github.io/Project4-Shape-Grammar/'>Demo</a></div></div>\n\n<h3 id=\"shape-grammar\">Shape Grammar</h3>\n<div class='project'><div class='name'>Rishabh Shah</div><iframe src='//www.giphy.com/embed/l4FGnStVbLlZUMrmw'></iframe><div class='links'><a href='https://github.com/rms13/Project4-Shape-Grammar'>Github</a> | <a href='https://rms13.github.io/Project4-Shape-Grammar/'>Demo</a></div></div>\n<div class='project'><div class='name'>Zack Elliot</div><iframe src='//www.giphy.com/embed/l0Iy6ani7jjBU9J1S'></iframe><div class='links'><a href='https://github.com/zelliott/Project4-Shape-Grammar'>Github</a> | <a href='https://zelliott.github.io/Project4-Shape-Grammar/'>Demo</a></div></div>\n<div class='project'><div class='name'>Tabatha Hickman</div><iframe src='//www.giphy.com/embed/l4FGKWoK9mmEtMt7a'></iframe><div class='links'><a href='https://github.com/tabathah/Project4-Shape-Grammar'>Github</a> | <a href='https://tabathah.github.io/Project4-Shape-Grammar/'>Demo</a></div></div>\n<div class='project'><div class='name'>Mariano Merchante</div><iframe src='//www.giphy.com/embed/3og0IGkTOr4jq2KXbW'></iframe><div class='links'><a href='https://github.com/mmerchante/Project5-Shaders'>Github</a> | <a href='https://mmerchante.github.io/Project5-Shaders/'>Demo</a></div></div>\n\n<h3 id=\"shaders\">Shaders</h3>\n<div class='project'><div class='name'>Dan McCann</div><iframe src='//www.giphy.com/embed/3o7bu2Fndj8I0AqsO4'></iframe><div class='links'><a href='https://github.com/mccannd/Project5-Shaders'>Github</a> | <a href='https://mccannd.github.io/Project5-Shaders/'>Demo</a></div></div>\n\n<h3 id=\"crowd-simulation\">Crowd Simulation</h3>\n<div class='project'><div class='name'>Zack Elliot</div><iframe src='//www.giphy.com/embed/3og0IP6fp8im5aXD32'></iframe><div class='links'><a href='https://github.com/zelliott/Project7-BioCrowds'>Github</a> | <a href='https://zelliott.github.io/Project7-BioCrowds/'>Demo</a></div></div>\n\n\n\n<h2 id=\"course-description\">Course Description</h2>\n<p>Sprawling cities, dense vegetation, infinite worlds &mdash; procedural graphics empower technical artists to quickly create complex digital assets that would otherwise be unfeasible. This course is intended to introduce the algorithmic foundations of procedural modeling, texturing and animation techniques, and to offer hands-on experience designing and implementing visual recipes in original graphics projects by applying these methods. Students should have a strong interest in both the creative and technical aspects of computer graphics, as well as a solid programming background.</p>\n<h2 id=\"prerequisites\">Prerequisites</h2>\n<p>CIS 460/560</p>\n<h2 id=\"course-goals\">Course Goals</h2>\n<ol>\n<li>Learn a toolkit of interesting procedural generation techniques<ul>\n<li>Understand the underlying theory</li>\n<li>Develop intuitions about how to apply and parameterize</li>\n</ul>\n</li>\n<li>Get familiar with new tools/technology for procedural artwork<ul>\n<li>javascript / three.js</li>\n<li>Houdini</li>\n</ul>\n</li>\n<li>Start or continue developing a portfolio of visually and technically inpressive work</li>\n<li>Practice approaching unstructured, open-ended problems </li>\n</ol>\n<h2 id=\"grading-policy\">Grading Policy</h2>\n<p>In-class exercises (20%), weekly homework assignments (50%) and the final project (30%) will constitute all of the grading for this class. Grading will be on the basis of the following:</p>\n<ul>\n<li><strong>Use of techniques:</strong> Does you assignment apply the techniques discussed in class in an interesting way? Did your approach to the project demonstrate creative thought?</li>\n<li><strong>Engineering effort/organization:</strong> Was your code well-structured, demonstrating a good understanding of software engineering principles?</li>\n<li><strong>Visuals:</strong> Ultimately, this class is about producing algorithmic visual output, so the look of your procedural artwork is important. We will not grade on the basis of whether we like your style, but we will grade based on how well you were able to achieve your intended effect, and how much effort you put into polishing the output.</li>\n</ul>\n";

