	module.exports = "<p>The objective of this assignment is to create an L System parser and generate interesting looking plants. Start by forking and then cloning this repository: <a href=\"https://github.com/CIS700-Procedural-Graphics/Project3-LSystems\">https://github.com/CIS700-Procedural-Graphics/Project3-LSystems</a></p>\n<h1 id=\"l-system-parser\">L-System Parser</h1>\n<p>lsystem.js contains classes for L-system, Rule, and LinkedList. Heres our suggested structure:</p>\n<p><strong>The Symbol Nodes/Linked List:</strong></p>\n<p>Rather than representing our symbols as a string like in many L-system implementations, we prefer to use a linked list. This allows us to store additional information about each symbol at time of parsing (e.g. what iteration was this symbol added in?) Since were adding and replacing symbols at each iteration, we also save on the overhead of creating and destroying strings, since linked lists of course make it easy to add and remove nodes. You should write a Linked List class with Nodes that contain at least the following information:</p>\n<ul>\n<li>The next node in the linked list</li>\n<li>The previous node in the linked list</li>\n<li>The grammar symbol at theis point in the overal string</li>\n</ul>\n<p>We also recommend that you write the following functions to interact with your linked list:</p>\n<ul>\n<li>A function to symmetrically link two nodes together (e.g. Node As next is Node B, and Node Bs prev is Node A)</li>\n<li>A function to expand one of the symbol nodes of the linked list by replacing it with several new nodes. This function should look at the list of rules associated with the symbol in the linked lists grammar dictionary, then generate a uniform random number between 0 and 1 in order to determine which of the Rules should be used to expand the symbol node. You will refer to a Rules probability and compare it to your random number in order to determine which Rule should be chosen.</li>\n</ul>\n<p><strong>Rules:</strong></p>\n<p>These are containers for the preconditions, postconditions and probability of a single replacement operation. They should operate on a symbol node in your linked list.</p>\n<p><strong>L-system:</strong></p>\n<p>This is the parser, which will loop through your linked list of symbol nodes and apply rules at each iteration.</p>\n<p>Implement the following functions in L-System so that you can apply grammar rules to your axiom given some number of iterations. More details and implementation suggestions about  functions can be found in the TODO comments</p>\n<ul>\n<li><code>stringToLinkedList(input_string)</code></li>\n<li><code>linkedListToString(linkedList)</code></li>\n<li><code>replaceNode(linkedList, node, replacementString)</code></li>\n<li><code>doIterations(num)</code></li>\n</ul>\n<h2 id=\"turtle\">Turtle</h2>\n<p><code>turtle.js</code> has a function called renderSymbol that takes in a single node of a linked list and performs an operation to change the turtles state based on the symbol contained in the node. Usually, the turtles change in state will result in some sort of rendering output, such as drawing a cylinder when the turtle moves forward. We have provided you with a few example functions to illustrate how to write your own functions to be called by renderSymbol; these functions are rotateTurtle, moveTurtle, moveForward, and makeCylinder. If you inspect the constructor of the Turtle class, you can see how to associate an operation with a grammar symbol.</p>\n<ul>\n<li><p>Modify turtle.js to support operations associated with the symbols <code>[</code> and <code>]</code></p>\n<ul>\n<li>When you parse <code>[</code> you need to store the current turtle state somewhere</li>\n<li>When you parse <code>]</code> you need to set your turtles state to the most recently stored state. Think of this a pushing and popping turtle states on and off a stack. For example, given <code>F[+F][-F]</code>, the turtle should draw a Y shape. Note that your program must be capable of storing many turtle states at once in a stack.</li>\n</ul>\n</li>\n<li><p>In addition to operations for <code>[</code> and <code>]</code>, you must invent operations for any three symbols of your choosing.</p>\n</li>\n</ul>\n<h2 id=\"interactivity\">Interactivity</h2>\n<p>Using dat.GUI and the examples provided in the reference code, make some aspect of your demo an interactive variable. For example, you could modify:</p>\n<ol>\n<li>the axiom</li>\n<li>Your input grammer rules and their probability</li>\n<li>the angle of rotation of the turtle</li>\n<li>the size or color or material of the cylinder the turtle draws, etc!</li>\n</ol>\n<h2 id=\"l-system-plants\">L-System Plants</h2>\n<p>Design a grammar for a new procedural plant! As the preceding parts of this assignment are basic computer science tasks, this is where you should spend the bulk of your time on this assignment. Come up with new grammar rules and include screenshots of your plants in your README. For inspiration, take a look at Example 7: Fractal Plant in Wikipedia: <a href=\"https://en.wikipedia.org/wiki/L-system\">https://en.wikipedia.org/wiki/L-system</a> Your procedural plant must have the following features</p>\n<ol>\n<li>Grow in 3D. Take advantage of three.js! </li>\n<li>Have flowers or leaves that are added as a part of the grammar</li>\n<li>Variation. Different instances of your plant should look distinctly different!</li>\n<li>A twist. Broccoli trees are cool and all, but we hope to see sometime a little more surprising in your grammars</li>\n</ol>\n<h1 id=\"publishing-your-code\">Publishing Your code</h1>\n<p>Running <code>npm run deploy</code> will automatically build your project and push it to gh-pages where it will be visible at <code>username.github.io/repo-name</code>. NOTE: You MUST commit AND push all changes to your MASTER branch before doing this or you may lose your work. The <code>git</code> command must also be available in your terminal or command prompt. If you&#39;re using Windows, it&#39;s a good idea to use Git Bash.</p>\n";

